import React from 'react';

function Result(props){

  const { data } = props.location.state;

  return (
    <div>
    <h1>Result</h1>
    <p>Input 1: {data.name}</p>
    <p>Input 2: {data.range}</p>
  </div>
  );
};

export default Result;
